function getAllScore(data, cname, ss) {
    var score = [];
    var s = []; //记录分数区间人数
    for(var x = 0; x < 9; x++) {
        s[x] = 0;
    }
    for(i in data) {
        cname.push(i);

        var t1 = data[i];
        for(j in t1) {
            var t2 = t1[j];
            for(z in t2) {
                if(z == 'score') {
                    if(t2[z] >= 800) s[8]++;
                    else if(t2[z] >= 700) s[7]++;
                    else if(t2[z] >= 600) s[6]++;
                    else if(t2[z] >= 500) s[5]++;
                    else if(t2[z] >= 400) s[4]++;
                    else if(t2[z] >= 300) s[3]++;
                    else if(t2[z] >= 200) s[2]++;
                    else if(t2[z] >= 100) s[1]++;
                    else s[0]++;
                }
            }
        }
        score.push(s);
        s = [];
        for(var x = 0; x < 9; x++) {
            s[x] = 0;
        }
    }
    var temp, i, len, j;
    len = cname.length;
    for(j = 0; j < len - 1; j++) {
        for(i = 0; i < len - 1 - j; i++)
            if(cname[i] > cname[i + 1]) {
                temp = cname[i];
                cname[i] = cname[i + 1];
                cname[i + 1] = temp;
                temp = score[i];
                score[i] = score[i + 1];
                score[i + 1] = temp;
            }
    }
    //var ss = [];
    for(var x = 0; x < cname.length; x++) {
        ss[x] = [];
    }

    s = [];
    for(var i = 0; i < score.length; i++) {
        for(var j = 0; j < score[i].length; j++) {
            ss[j].push(score[i][j]);
        }
    }
}
