//整理数据函数
//data是数据,g是存放数据的数组-0是班级名字，1是班级排名，2是学校排名，3是总分
function getyk(data, g) {
    var g1 = [],
        g2 = [],
        g3 = [];
    var className = [];
    var classRank = [];
    var schoolRank = [];
    var score = [];
    for(i in data) {
        //每个班级
        className.push(i); //存班级名
        var t1 = data[i];
        var te = [];
        for(j in t1) {
            //单个班级内状况
            var t2 = t1[j];
            for(z in t2) {
                //单个人
                te.push(t2[z]);
            }
            classRank.push(te[0]);
            schoolRank.push(te[1]);
            score.push(te[2]);
            te = [];
        }
        g1.push(classRank);
        g2.push(schoolRank);
        g3.push(score);
        //console.log(i);
        //console.log(className[1]);
        //console.log(classRank);
        //console.log(schoolRank);
        //console.log(score);
        ///className = [];
        classRank = [];
        schoolRank = [];
        score = [];
    }
    var temp, i, len, j;
    len = className.length;
    for(j = 0; j < len - 1; j++) {
        for(i = 0; i < len - 1 - j; i++)
            if(className[i] > className[i + 1]) {
                temp = className[i];
                className[i] = className[i + 1];
                className[i + 1] = temp;
                temp = g1[i];
                g1[i] = g1[i + 1];
                g1[i + 1] = temp;
                temp = g2[i];
                g2[i] = g2[i + 1];
                g2[i + 1] = temp;
                temp = g3[i];
                g3[i] = g3[i + 1];
                g3[i + 1] = temp;
            }
    }
    g.push(className);
    g.push(g1);
    g.push(g2);
    g.push(g3);
}
//下拉选择框功能
function ddb(sq,len) {
    if(len==null) len=9;
    //全部隐藏
    for(var i = 1; i <= len; i++) {
        var s = '#m' + sq + '-';
        s += i;
        $(s).hide();
    }
    //展示第一个
    $('#m' + sq + '-1').show();
    var id = "#t" + sq;
    var oSelect = $(id);
    //当下拉框被选择
    oSelect.on('change', function() {
        var checkValue = $(id).val();
        //先隐藏全部
        for(var i = 1; i <= len; i++) {
            var s = '#m' + sq + '-';
            s += i;
            $(s).hide();
        }
        var s = '#m' + sq + '-' + checkValue;
        //再展示下拉框选择的部分
        $(s).show();
    });
}